import React from "react";
import {truck ,cement ,chemicals ,bricks ,flyash ,sands} from '../../utils/Icon';

import { frame } from "../../utils/Constant";

const Frame = () => {

  return (
    <div className="Frame w-full h-auto">

        <div className="grid gap-0 grid-cols-4 grid-rows-2 ">
          {frame.map((k, i) => {
            return <div className="ring-1 inline-flex items-center">
                <span className=" items-center relative ml-[5rem] mt-[2rem]  mr-[2rem]" key={i}>{k.title}</span>
            </div>;
          })}
        </div>

      </div>
  );
};

export default Frame;
